import React from 'react';
import {Link} from '../../routes';

const IndexView = () => {

    return (
        <>
            <h1>Test Here!</h1>
            <nav>
                <ul>
                    <li>
                        <Link route={"/css"}>
                            <a>Css Test</a>
                        </Link>
                    </li>
                </ul>
            </nav>
        </>

    )
}

export default IndexView;
